import React, { Component } from "react";
import '../css/Hiring.css';

class Hiring extends Component {
  render() {
    return (
        <div class = "containerHiring"> 
            <div className="subContainerHiring">
                <h1>Updates coming to you really soon!!!!</h1>
            </div>
        </div>
    );
  }
}

export default Hiring;
